import logo from './logo.svg';
import {useState} from "react";
import './App.css';
import "./App.scss";

const App = () => {
  const [menuOpen, toggleMenu] = useState(false);
  return (
    <div className="App">
      <label for="hamburger">
      <input
        type="checkbox"
        checked={menuOpen}
      />
        <input id="hamburger"
          type="checkbox"
          checked={menuOpen}
          onClick={() => {
            menuOpen? toggleMenu(false): toggleMenu(true);
          }}
        />
        <div />
        <div />
        <div />
      </label>
      {menuOpen? "opened": "closed"}
    </div>
  );
}

export default App;
